import React from 'react';
import { Document, Page } from 'react-pdf';

import samplePDF from './akk.pdf';

export default function Test() {
    return (

        <Document file={samplePDF}>
            <Page pageNumber={1}  onLoadError={console.error}/>
            <i>{console.log}</i>
        </Document>
    );
}
